import { Button } from 'primereact/button';
import { Calendar } from 'primereact/calendar';
import react, { useEffect, useState } from "react";

import { ReactDOM } from 'react';
import "./index.css";
import {ZodiacSignsDetail} from './data'; 



function App(){
    
    const [date,setDate]=useState();
    
function eventHandler(e){
    e.preventDefault();
}
   

    return(
        

       
       <div>
       
            <div className='header'><h1>Zodiac Calendar</h1></div>
            <div  className='cal'><Calendar id='cal' placeholder='Choose Date' value={date} onChange={(e) => setDate(e.value) } />
            <Button label="search" severity="search" onClick={eventHandler} id='btn'/>
            </div>
            <Card/>

          
                </div>
        
  
    );
    

}

function Card(){
    return(
        <section >
            <img src='D:\new\react\\img\aries.jpg' alt=''/>
          
          <Description />  
        </section>

       
    );
}
function Description(){
    return (
        <div> {ZodiacSignsDetail.map((ZodiacSignsDetail)=>{
            return ( <div className='card'><li>{ZodiacSignsDetail.Name}</li>
            <li>{ZodiacSignsDetail.MyanmarMonth} </li></div> )})}</div>
       
        
        );
}

export default App;
